import FeedbackItems from "./FeedbackItems";

function FeedbackList({feedback}){
    if(feedback.length===0||!feedback){
        return <p>No feedback yet</p>
    }
    return(
        <div>
            {feedback.map((item)=>
            <FeedbackItems key={item.id} item={item}/>)}
        </div>
    )
  
}
export default FeedbackList
